import React, {Component} from 'react'

class EmpleadosList extends Component {

    state = {
        empleados: []
    }

    cargarEmpleados = () => {
        fetch('http://localhost:8000/api/empleados/', {
            method: 'GET',
            headers: {'Content-Type': 'application/json'},
            body: JSON.stringify(this.state.empleados)
        })
        .then(data => data.json())
        .then(
            data => {
                this.setState({empleados: data})
            }
        )
        .catch( error => console.error(error))
    }

    render(){
        return(
            <div>
                <h2>Empleados</h2>
                {this.state.empleados.map(empleados => {
                    return <h3 key={empleados.id_empleado}>{this.empleados}</h3>
                })}
                <button onClick={this.cargarEmpleados}>Cargar empleados</button>
            </div>
        )
    }

}

export default EmpleadosList
